import React from "react";
import styles from './Block2.module.scss'

const Text = (props) => {
    let style;

    if(props.tmp === 0) {
        style = styles.Block2__TextColom__TextBig;
    } else {
        style = styles.Block2__TextColom__TextSmall;
    }

    return(
        <p className={style}>{props.text1}<br />{props.text2}</p>
    )
}

